INSERT INTO `email_template` (`id`, `title`, `message`, `created_at`) VALUES
(1, 'Sports Day Events', '<p>Games that are played on school sports days can be wide and varied. They can include straightforward sprints and longer races for all age groups as well as egg and spoon races. </p>', '2023-08-24'),
(2, 'National Republic Day', '<p>India celebrated its 73rd National Republic Day on the 26th of January, 2022. The constitution of India was adopted on the 26th of November, 1949 with Dr. B. R. Ambedkar as the Chairman of the Drafting Committee.</p>', '2023-08-24'),
(3, 'Annual Day Celebration', '<p>A day in School – In this theme the program can showcase, what all goes in school. The ringing of bell, the class, the love of teachers, happy-go-lucky punishments, all pranks, PTM, sports etc.</p>', '2023-08-24'),
(4, 'Summer Vacation', '<p>Summer vacation is the best time of the year as it gives me a chance to relax and explore new things. It gives me an opportunity to take a break from my daily study routine and adopt new hobbies like gardening, dancing and painting, while also having fun with friends.</p>', '2023-08-24'),
(5, 'Independence Day Celebration!!!!!! Notification', '<p>All the students of our school are hereby informed that our school is going to celebrate the Independence Day like previous years in the school premises. Students are requested to note that on the 15th August they will be assembled on the school ground at 7:30 a.m. positively.</p>', '2023-08-24'),
(6, 'Admission Camp', '<p>Admission camp is an online education website that delivers timely blogs related to the field of education. We also deliver general education related</p>', '2023-08-24');
